DROP FUNCTION IF EXISTS `getStatistics`;
delimiter ;;
CREATE FUNCTION `getStatistics`()
 RETURNS double
BEGIN
	#Routine body goes here...
	declare c DOUBLE;
	
	declare last_year DOUBLE;
	declare this_year DOUBLE;
	
	# 前一年
	SELECT count(*) into last_year from geological where DATE_FORMAT(geological.date, '%Y') = DATE_FORMAT(NOW(), '%Y')-1 ;

	# 今年;
	SELECT count(*)  into this_year from geological where DATE_FORMAT(geological.date, '%Y') = DATE_FORMAT(NOW(), '%Y');
	
	set c = (this_year - last_year) / last_year;
	RETURN c;
END
;;
delimiter ;

